function sendColors(shutdown = false){

	let packet = [];
	packet[0] = 0x00;
	packet[1] = 0x08;
	packet[2] = 0x06;
	packet[3] = 0x00;
	packet[4] = 0x12;
	packet[5] = 0x00;
	packet[6] = 0x00;
	packet[7] = 0x00;
	packet[8] = 0x00;

	for(let iIdx = 0; iIdx < vKeyPositions.length; iIdx++) {
		let iPxX = vKeyPositions[iIdx][0];
		let iPxY = vKeyPositions[iIdx][1];
		var col;

		if(shutdown){
			col = hexToRgb(shutdownColor);
		}else if (LightingMode === "Forced") {
			col = hexToRgb(forcedColor);
		}else{
			col = device.color(iPxX, iPxY);
		}

		packet[iIdx +  9] = col[0];
		packet[iIdx +  15] = col[1];
		packet[iIdx +  21] = col[2];
	}

	//  08 06 00 12 00 00 00 00 2D 2D 2D 2D 2D 00 FF FF FF FF FF 00 29 29 29 29 29 00 00 00
	device.write(packet, 65);
}

